```python
def rhyme(word1, word2):
    # convert words to lower case
    word1 = word1.lower()
    word2 = word2.lower()
    # define rhyming parts of the vowels according to the hebrew pronounce rules
    vowels = ['a', 'e', 'i', 'o', 'u']
    pron_v = {'a': ['a', 'a'], 'e': ['e', 'e'], 'i': ['i', 'i'], 'o': ['o', '@o'], 'u': ['u', 'y']}
    # find the rhyming vowels in the two words and their indices
    rhyme_vowels = [[], []]
    for i, letter in enumerate(word1):
        if letter in vowels:
            if letter in pron_v and word2[i] in pron_v[letter][0]:
                rhyme_vowels[0].append((i, letter))
            elif letter in pron_v and word2[i] in pron_v[letter][1]:
                rhyme_vowels[1].append((i, letter))
    # check if there are any rhyming vowels between the two words
    if len(rhyme_vowels[0]) > 0 and len(rhyme_vowels[1]) > 0:
        # find the matching rhyme groups
        rhyme_groups = []
        for i, rhyme_vowel in enumerate(rhyme_vowels[0]):
            for j, rhyme_vowel2 in enumerate(rhyme_vowels[1]):
                if rhyme_vowel2[1] == rhyme_vowel[1]:
                    # if there are multiple rhyming words, combine the corresponding rhyme groups
                    group = [(i, rhyme_vowel[0]), (j, rhyme_vowel2[0])]
                    if any(group == rhyme_group for rhyme_group in rhyme_groups):
                        continue
                    rhyme_groups.append(group)
        # if there are any matching rhyme groups, get the corresponding rhyming words
        if len(rhyme_groups) > 0:
            rhyme_words = []
            for group in rhyme_groups:
                rhyme_word = ''
                for i, index in enumerate(group):
                    letter = word1[index[0]]
                    num = 0 if i == 0 else 1
                    if letter in pron_v:
                        if index[1] == 0:
                            pos = pron_v[letter][0].index(word2[index[0]])
                        else:
                            pos = pron_v[letter][1].index(word2[index[0]])
                        if pos < len(pron_v[letter][num]):
                            rhyme_word += pron_v[letter][num][pos]
                        else:
                            rhyme_word += pron_v[letter][num][-1]
                    else:
                        rhyme_word += letter
                rhyme_word = rhyme_word.capitalize()
                rhyme_words.append(rhyme_word)
            return ', '.join(rhyme_words)
    return 'NONE'
